import React from 'react';

function ContactDetails({ contact }) {
  return (
    <div>
      <h2>{contact.name}</h2>
      <p>{contact.email}</p>
      <p>{contact.phone}</p>
      <p>{contact.website}</p>
      <p>{contact.address.street}, {contact.address.city} {contact.address.zipcode}</p>
      <p>{contact.company.name} - {contact.company.catchPhrase}</p>
    </div>
  );
}

export default ContactDetails;
